  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report is to provide
  information on the presence, species composition, and abundance of marine benthic
  infauna in Cube Cove on northwest Admiralty Island. The species composition, abundance
  and diversity of marine benthic infauna in Cube Cove on northwest Admiralty Island
  were determined by collecting and analyzing fifteen randomly selected.25 meters
  squared bottom samples. The study results indicate that the density and abundance
  of marine infauna in Cube Cove are comparable to, if not greater than, other undisturbed
  nearshore areas in Alaska.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
